import React from 'react'

function PopUpNote (props) {
  handleUpdateNote 
  return (
    <div className='pop-up-note'>
      <textarea value='Enter notes' onChange={event => handleUpdateNote(event) }>{props.item.noteText}</textarea>
      <button>Close</button>
    </div>
  )
}

export default PopUpNote
